import styled from "styled-components";


function PostImgBox() {


  return (
    <Block>
      <ImgList>
        <li>
          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRs5kRQiTrf6hMha6Yii7JZZMc8Bwd9uPtdPg&usqp=CAU"
            alt="iu"
          ></img>
        </li>
      </ImgList>
    </Block>
  );
}




const Block = styled.div`
  height: 200px;
  overflow: hidden;
`;

const ImgList = styled.ul`
  display: flex;

  li {
    height: 100%;
    img {
      height: 100%;
    }
  }
`;

export default PostImgBox;
